// STYLE
import './NotFound.css';
// =======================================================
// FONT AWESOME
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBug } from '@fortawesome/free-solid-svg-icons';
// =======================================================
const NotFound = () => {
    return(
        <div className="notFound">
            <FontAwesomeIcon icon={faBug} />
            <h1>404</h1>
            <p>Not Found</p>
        </div>
    )
}
export default NotFound;
